expressions/structures-de-controle.html.body:
Control structures
To create a valid program, you must be able to make decisions, iterate on sets, or repeat instructions several times. This section will present the control structures offered by the Ymir language.
Condition
The simplest control structure is the if else construction.
if a 
In Ymir, a condition must be of the bool type, it is impossible
to use other types as integers as one could do in other C-like
language. The content of an if instruction is an instruction block,
where creating a block containing several instructions with {}
tokens is optional, if you want to execute only one instruction.
The `ifelse construct can be used as an expression, so you can retrieve the value of a conditional expression.
let x = true;
let a = 1 + if (x) 100 else 2;

Loops
The Ymir language offers several control structures to loop, or iter on sets.
While
The `while' loop is very similar to that of other languages close to C.
let i = 0;
while i 
Break
Sometimes it is convenient to be able to stop a loop before its condition forces it to stop. The keyword break allows you to do this.
let i = 0;
while i 
You can use the keyword break to stop a parent loop using a tag.
let i = 0;
let j = 0;
while: firstLoop (i 
For
The `for' loop allows you to iterate on a collection of elements such as an array, or a range.
for i in ["One", "Two", "Three"] {
    print (i, ","); 
} // One, Two, Three,

let a = [5, 3, 1];
for i in 0 .. 3 {
    print (i, ","); }
} // 0, 1, 2,

for i in 0UL .. a.len {
    print (a [i], ","); 
} // 5, 3, 1, 

for i in 3 .. 0 {
    print (i, ",");
} // 3, 2, 1,

As with while' loops, it is possible to tag afor' loop so that it can be referred to in a `break' instruction.
for:loop (i in [1, 2, 3]) {U
    break loop;
}

expressions/pattern_matching.html.body:
Pattern matching
Pattern matching is a special control structure that allows you to
decompose values in order to easily verify a condition set with a very
expressive and quite intuitive syntax.
Simple patterns
You can use literals directly as in a classic switch case`.
let x = 2;

match x {
    1 => println ("One");
    2 => println ("Two"); 
    3 => println ("Three");
    _ => println ("Any other case");
} // this prints 'Two'

Multiple patterns, and range
The operator | allows to check several values in the same case.
let x = 2;

match x {
    1 | 2 => println ("one or two");
    3 => println ("three");
} // this prints 'one or two'

It is also possible to create a range to check that a value is present in an interval.
let x = 2;


match x {
    1 ... 3 => println ("between 1 and 3");
    _ => println ("Any other case"); 
} // This prints 'between 1 and 3'

Destructuring
The pattern matching allows to destructure values in order to retrieve the attributes and test them.
For example if you have the following structure : 
struct 
| x : i32
| y : i32
 -> Point;

The following test allows to deconstruct this type.
let z = Point {1, 2};

match z {
    Point {1, 2} => println ("I am a point with the value 1, and 2");
}

Destructuring can also be applied to tuple.
Binding
Values can be passed in a variable to test their type and recover their value.
let x = 1; 

match x {
    y : i32 => println (y); // any value of type i32
    z => println (z); // any value of any type
}

Binding only works on undeclared variable names, in other cases the value of the variable is used, for example : 

let x = 1;
let c = 12;

match c {
    x => println (x); // the test is (x == c), meaning is c equals to 1 ?
} // This prints nothing

Reference binding
The binding can be done by reference in order to modify the associated variable.
let x = 1;

match x {
    ref y : i32 => {
        println (y); // 1
        y = 21;
    }
}

println (x); // 21

Ignoring the pattern
The _ token allows you to define that you are not interested in the value and that therefore all values are accepted by this pattern.
let x = Point {1, 2};

match x {
    Point {_, _} => println ("Any point");
    _ => println ("Anything");
} // This prints 'Any point'

Guards
Works in progress !! 
Mixing all that

struct
| entry : Point
| len : i32
 -> Square;

struct
| x : i32
| y : i32
 -> Point;

def main () {
    let z = Square {Point {1, 2}, 23};

    match z {
        Square { Point { 1 | 3, ref y : i32 }, ref len : i32 } => {
            y = 8;
            len = 54;
        }
    }

    println (z); // main.SquareS(main.PointS(1, 8), 54)

}

