types-personnalises/structures.html.body:
Structures
A structure is a custom type, allowing you to group several values into a type with a name. Their composition is equivalent to that of the tuples, we can see the tuples as anonymous structures. The keyword struct allows you to define a new structure.

// A structure with two fields
struct 
| x : f64,
| y : f64
 -> Point;

// A structure can contain fields whose type is a structure
struct
| a : Point
| b : Point
 -> Rectangle;

def main () {
    // You must fill in all the data to build a structure
    let point = Point { 1.1, 1.7 };

    // It is also possible to build a structure without giving it any value
    // All fields will be filled with their value::init
    let point2 = Point::init; 

    // It is possible to transform a structure into a tuple
    let (x, y) = point.tupleof;
    println ("(", x, ", ", y, ")");

    let rect = Rectangle { point, Point { 3.3, 4.5 } };

    // Structures are displayable elements
    println (rect);
}

Structure attributes
It is possible to modify the alignment of types in a structure. To do this, you must use a structure attribute, which is declared at the same time as the structure using the @ token.

struct @packed
| a : char 
| b : i32
| c : char
 -> Packed;

struct 
| a : char
| b : i32 
| c : char 
 -> Unpacked;

def main () {
    println (Packed::sizeof); // 6
    println (Unpacked::sizeof); // 12
}

types-personnalises/unions.html.body:
Union
The union types are equivalent to the struct type, except that the fields that make up a union share the same memory area. The keyword union allows you to declare a type union. 
union 
| i : i32
| d : f64
 -> MyUnion;

def main () {

    // Only one of the elements of the union is necessary to build it
    // The first compatible element is used 

    let a = MyUnion { 12 }, b = MyUnion { 1200.05 };
    let c = MyUnion {'r'}; // Error

    println (b.i, " ", b.d, " ", b::sizeof); // 858993459 1200.050000 8        
}

types-personnalises/enums.html.body:
Enums
Enums are special types with a set of values. The keyword enum allows to define a enumerated type, whose field type is inferred from the compilation. It is mandatory that each field has the same type.
// This enum is a string type enum
enum 
| Engineer : "eng",
| Scientist : "sci"
 -> Person;

// This function takes a Person enum as a parameter
def inspect (p : Person) {

    //     We can use pattern matching to choose between several values
    match p {
        Person::Engineer => println ("Engineer");
        Person::Scientist => println ("Scientist");
    }
}

def main () {
    let michel = ("Michel", Person::Engineer);

    inspect (michel.1);
    inspect (Person::Scientist);
}

types-personnalises/objects/attrs.html.body:
Objects attributes
As mentioned above, objects are built from a
predefined type.  This type will be used as a basis for the construction of the
new object type, and therefore this predefined type will be used to
define the data fields of the type.
This data can be accessed as one would access the elements of a tuple, with the operator ..
These attributes are private and can only be accessed from the type.
struct 
| x : i32
| y : i32
 -> Point; 


type MyType impl Point {

    self () { // type constructor
        self.0.x = 10;
        self.0.y = 2;
    }

}

let a = MyType::init (); // Construct the type
a.0.x = 20; // Error, fields are private

Since only one field has an x attribute, it can be accessed directly.
// ...
    self () {
        self.x = 10; // Ok
    }
// ...

In the case where several fields have the same field name, this kind of fast access is not possible and an error would be returned.
Aliases of data fields
Since it can be complicated to write a data access, and since the
naming of attribute variables is an important point for the
readability of the source code, the alias of data fields allows to
name the accesses to these data.

type Square impl (u64, Point) {

    let len : self.0;
    let x : self.1.x;
    let y : self.1.y;

    self (x : i32, y : i32) {
        self.x = x;
        self.y = y;
        self.len = 1;
    }

}

let sq = Square::init (1, 2);
println (sq.x, " ", sq.y, " ", sq.len); // Ok, by default aliases are public

It is possible to specify data protection, using the keyword private
and protected.  By default the protection is considered public and
therefore the fields are accessible from outside the type.  The
keyword private specifies that access is exclusive to the type, and
protects that access is exclusive to the type and its heirs.

type Square impl (u64, Point) {

    private let _len : self.0; // To comply with the naming convention recommended in ymir, the private fields must be preceded by a _

    private {// Multiple line private block
        let _x : self.1.x;
        let _y : self.1.y;
    }

    self (x : i32, y : i32) {
        self._x = x;
        self._y = y;
        self._len = 1;
    }

}

let sq = Square::init (1, 2);
println (sq._x, " ", sq._y, " ", sq._len); // Error, fields are private

Union implementation
Union types can be implemented without any problems. Moreover, it sometimes happens, for heritage reasons (which will be explained later), that we need a type to be of several different types without wanting to create a union type.
To do this, it is possible with the `||' token to create a tuple union, and implement it.

type MySpecialInteger impl (i8 | i16 | i32 | i64, u8 | u16 | u32 | u64) {

    private let _signed : self.0;
    private let _unsigned : self.1;

    self () {
        self._signed.3 = 8L;
        self._unsigned.0 = 8B;
    }

    def print (self) { // A method
        println (self._signed.0); 
    }

}

def main () {
    let a = MySpecialInteger::init ();
    a.print (); // 8
}

Of course tuple unions can be used in other contexts, the section
Tuples presents in detail their use.
